import React, { Fragment } from 'react';
import MaterialTable from 'material-table';
import RealTimerReport from '../../../core/report'
import TableIcons from '../../common/materialicon'



export default class LockerStatusReport extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
        };
    }
    columns = [
        { title: 'Tòa nhà', field: 'Build' },
        { title: 'Tầng', field: 'Floor' },
        { title: 'Tủ', field: 'lLabel' },
        { title: 'Trạng thái', field: 'status' },
        { title: 'Người sử dụng cuối cùng', field: 'LastUser' },
        { title: 'ID nhân sự', field: 'IdNV' },
        { title: 'Thời điểm thao tác lần cuối', field: 'LastTime' },
    ]

    options = {
        search: false,

    }

    getDataFromServer = (query) => {
        return new Promise((resolve, reject) => {
            RealTimerReport.getStatusReport()
                .then(value => {
                   console.log(value)
                })
        })
    }

    componentDidMount() {
    }

    render() {
        return(
            <div>
                <MaterialTable 
                title = 'Báo cáo trạng thái các tủ đang hoạt động trong hệ thống'
                columns = {this.columns}
                options = {this.options}
                icons= {TableIcons}
                data = {this.getDataFromServer}
                />
            </div>
        )
    }
}
